import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { PhoneListComponent } from './phone-list/phone-list.component';

import { HttpClientModule } from '@angular/common/http';

import { FormsModule } from '@angular/forms';
import { TechshopAboutComponent } from './techshop-about/techshop-about.component';
import { ShoppingCartComponent } from './shopping-cart/shopping-cart.component';
import { TechshopTechsComponent } from './techshop-techs/techshop-techs.component';
import { ItemsQuantityComponent } from './items-quantity/items-quantity.component';
import { SongsComponent } from './songs/songs.component';
import { AlbumsComponent } from './albums/albums.component';
import { FavouritesComponent } from './favourites/favourites.component';

@NgModule({
  declarations: [
    AppComponent,
    PhoneListComponent,
    TechshopAboutComponent,
    ShoppingCartComponent,
    TechshopTechsComponent,
    ItemsQuantityComponent,
    SongsComponent,
    AlbumsComponent,
    FavouritesComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    HttpClientModule,
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
